/* eslint-disable @typescript-eslint/no-explicit-any */
// images
declare module '*.png' {
  const src: string
  export default src
}
declare module '*.jpg' {
  const src: string
  export default src
}
declare module '*.jpeg' {
  const src: string
  export default src
}
declare module '*.svg' {
  const src: string
  export default src
}
declare module '*.module.css' {
  const src: any
  export default src
}
